function present(ax,ay,bx,by,cx,cy,dx,dy){
  function getFront (x,y){
    var frontCount;
    for (i=0;i<x.length;i++){
        if(i+2){
          var hyp1 = Math.hypot(x[i], y[i]);
          var hyp2 = Math.hypot(x[i+1], y[i+1]);
          var hyp3 = Math.hypot(x[i+2], y[i+2]);
          if(hyp1 < hyp2 && hyp2 > hyp3 && hyp2 > .999){
            frontCount = i;
          }
      }
    }
    return (frontCount)
  }

  var frontA = getFront(ax,ay);
  var frontC = getFront(cx,cy);

  console.log('frontA = ' + frontA);
  console.log('frontC = ' + frontC);

  //var mainFront = frontA;
  if (frontA <= frontC){
    mainFront = frontA;
  } else{
    mainFront = frontC;
  }
  var mainBack = Math.abs(ax.length - mainFront);
  console.log('mainFront = ' + mainFront);
  console.log('mainBack = ' + mainBack);

  function separate (ax,ay,bx,by,cx,cy,dx,dy){
    var obj = {
      axFront: [],
      ayFront: [],
      bxFront: [],
      byFront: [],
      cxFront: [],
      cyFront: [],
      dxFront: [],
      dyFront: [],
      axBack: [],
      ayBack: [],
      bxBack: [],
      byBack: [],
      cxBack: [],
      cyBack: [],
      dxBack: [],
      dyBack: []
      }

      for(i=0;i<ax.length;i++){
        if(i>=mainFront){
          obj.axFront.push(ax[i]);
          obj.bxFront.push(bx[i]);
          obj.cxFront.push(cx[i]);
          obj.dxFront.push(dx[i]);
          obj.ayFront.push(ay[i]);
          obj.byFront.push(by[i]);
          obj.cyFront.push(cy[i]);
          obj.dyFront.push(dy[i]);
        } else{
          obj.axBack.push(ax[i]);
          obj.bxBack.push(bx[i]);
          obj.cxBack.push(cx[i]);
          obj.dxBack.push(dx[i]);
          obj.ayBack.push(ay[i]);
          obj.byBack.push(by[i]);
          obj.cyBack.push(cy[i]);
          obj.dyBack.push(dy[i]);
        }
      }
    return obj
  }
  var showObj = separate(ax,ay,bx,by,cx,cy,dx,dy)
  console.log(showObj)

  var acFrontx = [];
  var acFronty = [];
  var bdBackx = [];
  var bdBacky = [];
  var cdFrontx = [];
  var cdFronty = [];
  var cdBackx = [];
  var cdBacky = [];
  var arrx = [];
  var arry = [];

  function combine(x1,y1,x2,y2,arrx,arry){
    for(i=0;i<x1.length;i++){
      arrx.push(x1[i]);
      arrx.push(x2[i]);
      arry.push(y1[i]);
      arry.push(y2[i]);
    }
  }

  combine(showObj.axFront,showObj.ayFront,showObj.cxFront,showObj.cyFront,acFrontx,acFronty);
  combine(showObj.bxBack,showObj.byBack,showObj.dxBack,showObj.dyBack,bdBackx,bdBacky);
  combine(showObj.cxFront,showObj.cyFront,showObj.dxFront,showObj.dyFront,cdFrontx,cdFronty);
  combine(showObj.cxBack,showObj.cyBack,showObj.dxBack,showObj.dyBack,cdBackx,cdBacky);




  // //1 = white
  // //0 = black
  var scale = 1;
  var frontUse = 1/(mainFront/2);
  var backUse = 1/(mainBack/2);
  // var text = '';
  // var buffer = '';
  // var endCounter = 0;


  function plot(arrx,arry,size){
    var k = 0;
    var m = 0;
    var colorVar = .9;
    for (i=0; i<arrx.length; i+=2){
      if(k<mainFront/2){
        var put = frontUse * m;
        m++
        //end should be 1
      }
      if(k>=mainFront/2 && k<=mainFront){
        var put = frontUse * m;
        m--
        //end should be 0
      }
      if(k>mainFront && k<=mainFront+(mainBack/2)){
        var put = backUse * m;
        m++
        //end should be 1
      }
      if(k>mainFront+(mainBack/2) && k<=mainFront+mainBack){
        var put = backUse * m;
        m--
        //end should be 0
      }

      buffer += 'newbuffer' + '\n';
      text += 'addvalue ' + endCounter + ' ' + arrx[i] + ' ' + arry[i] + '\n';
      text += 'addvalue ' + endCounter + ' ' + arrx[i+1] + ' ' + arry[i+1] + '\n';
      if(size == 's'){
        text += 'bcolor ' + colorVar + ' ' + put + ' ' + put + ' ' + endCounter + '\n'
      } else{
        text += 'bcolor ' + put + ' ' + put + ' ' + put + ' ' + endCounter + '\n'
      }
      k++
      endCounter++
    }
  }

  plot(bdBackx,bdBacky,'b')
  plot(cdBackx,cdBacky,'s')
  plot(acFrontx,acFronty,'b')
  plot(cdFrontx,cdFronty,'s')

}

